export default function App() {

  const [cities, setCities] = useState([]);

  useEffect(() => {
    const fetchCities = async () => {
      const cityList = await getAllCities();
      setCities(cityList);
      console.log(setCities(cityList));
    };
    fetchCities();
  }, []);


  return (
    <div>
      App
    <div>
        <PopularCities
          {...cities?.map((city) => (
            cities={city}
          ))}

        />
        </div>
      </div>
  )
}
